INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (155, "人助けが大好き！　前向き格闘娘", 44, "獣人族", "東山奈央", 100101, 8, "A", 16, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ", "人助け、応援", 27, 2, "ヒヨリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "戦闘のサポートが得意な、心優しい少女", 47, "ヒューマン", "種田梨沙", 100201, 4, "O", 17, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "トゥインクルウィッシュ", "料理、人間観察", 5, 2, "ユイ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "クールで何事にも真っ直ぐな剣士", 46, "魔族", "早見沙織", 100301, 1, "B", 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ", "読書、乗馬、お茶", 12, 2, "レイ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (128, "探検好きのイタズラっ子", 27, "ヒューマン", "諸星すみれ", 100401, 8, "O", 9, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "リトルリリカル", "いたずら、探検", 10, 5, "ミソギ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (146, "ヒーローに憧れる騎士見習いの少女", 40, "獣人族", "下田麻美", 100501, 11, "O", 12, "？？？", "王宮騎士団（NIGHTMARE）", "ヒーローごっこ", 25, 8, "マツリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "甘え上手なみんなの人気者", 42, "魔族", "浅倉杏美", 100601, 11, "O", 13, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "悪魔偽王国軍（ディアボロス）", "サックス", 22, 7, "アカリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (130, "プリン大好きゴースト娘", 32, "魔族", "雨宮天", 100701, 1, "B", 14, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 23, 7, "ミヤコ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "ボクは誰よりも美しい", 40, "エルフ", "大空直美", 100801, 10, "AB", 14, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ヴァイスフリューゲル　ランドソル支部", "鏡で自分を見ること", 10, 15, "ユキ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (159, "前世を信じる中二病患者、「疾風の冥姫」", 45, "魔族", "髙野麻美", 100901, 7, "A", 17, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "トワイライトキャラバン", "小説執筆", 5, 13, "アンナ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (155, "マホマホ王国のプリンセス", 42, "獣人族", "内田真礼", 101001, 9, "O", 16, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "自警団（カォン）", "空想、ぬいぐるみ集め", 22, 10, "マホ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, "人懐っこくてマシンガントークな妹系少女", 44, "ヒューマン", "阿澄佳奈", 101101, 8, "A", 15, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "ラビリンス", "お裁縫", 25, 3, "リノ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, "みんなのために超能力を使う眠り姫", 46, "エルフ", "大橋彩香", 101201, 12, "A", 17, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "フォレスティエ", "妹と遊ぶこと、二度寝、昼寝、早寝", 24, 6, "ハツネ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (166, "オタク全開な魔法少女", 55, "魔族", "佳村はるか", 101301, 8, "O", 18, "", "トワイライトキャラバン", "読書、魔法", 21, 13, "ナナカ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (152, "頭脳明晰な美少女名探偵", 41, "獣人族", "水瀬いのり", 101401, 11, "AB", 15, "test", "自警団（カォン）", "読書、推理", 3, 10, "カスミ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (165, "母性溢れる優しいみんなの「ミサト先生」", 54, "エルフ", "國府田マリ子", 101501, 9, "O", 21, "test", "フォレスティエ", "絵本作り", 5, 6, "ミサト", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (167, "天真爛漫で人気者のカリスマモデル", 48, "魔族", "上坂すみれ", 101601, 4, "O", 18, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "ルーセント学院", "ファッション", 10, 14, "スズナ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "いつでも「なんくるないさ～」な天然娘", 53, "獣人族", "高森奈津美", 101701, 7, "A", 19, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "自警団（カォン）", "踊り、空手", 7, 10, "カオリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (162, "多くの男性を魅了する無垢な女教師", 52, "魔族", "伊藤静", 101801, 8, "B", 23, "いつも助けてくれてありがとう\n私のほうが年上なのに\n頼ってばかりでごめんなさい～", "ルーセント学院", "恋愛小説、恋愛舞台、恋愛漫画の鑑賞", 14, 14, "イオ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (117, "お歌もにんじんも、ウサギさんも大好き♪", 21, "獣人族", "日高里菜", 102001, 4, "O", 10, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "リトルリリカル", "かわいいもの集め", 3, 5, "ミミ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "泣き虫で臆病な守ってあげたい女の子", 40, "ヒューマン", "植田佳奈", 102101, 6, "B", 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", "観劇、おままごと", 9, 9, "クルミ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "人見知りであまのじゃくな女の子", 40, "魔族", "原紗友里", 102201, 11, "O", 13, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "悪魔偽王国軍（ディアボロス）", "ゲーム全般", 22, 7, "ヨリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (148, "ぷうきちといつも一緒！", 38, "ヒューマン", "芹澤優", 102301, 5, "B", 14, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "サレンディア救護院", "屋内でできる遊び", 10, 9, "アヤネ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (154, "お嬢さまのためにがんばるドジっ娘メイド", 43, "ヒューマン", "悠木碧", 102501, 12, "O", 15, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "サレンディア救護院", "ご奉仕", 12, 9, "スズメ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (144, "遊びと睡眠が何より大事なぐうたら娘", 42, "獣人族", "小岩井ことり", 102601, 1, "B", 17, "test", "牧場（エリザベスパーク）", "あんパン", 1, 11, "リン", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (154, "運命の相手に一途すぎる乙女", 43, "魔族", "橋本ちなみ", 102701, 7, "B", 16, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "トワイライトキャラバン", "実験、裁縫、料理", 30, 13, "エリコ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, "救護院を経営する優しい庶民派お嬢様", 43, "エルフ", "堀江由衣", 102801, 10, "A", 17, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレンディア救護院", "経営、お茶会", 4, 9, "サレン", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (157, "歌って踊れる大人気アイドル", 40, "ヒューマン", "日笠陽子", 102901, 1, "B", 17, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "カルミナ", "舞台鑑賞、ダンス", 24, 4, "ノゾミ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "トーゴクの神秘、オシエテクダサイ！", 51, "ヒューマン", "佐藤聡美", 103001, 8, "O", 16, "スシ、ゲイシャ、テンプラ…\nはふぅ～！\nトーゴクの文化はステキデスね～！", "ヴァイスフリューゲル　ランドソル支部", "忍法開発", 31, 15, "ニノン", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (157, "占いが得意な霊能少女", 42, "魔族", "大坪由佳", 103101, 12, "AB", 18, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "悪魔偽王国軍（ディアボロス）", "占い", 22, 7, "シノブ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (157, "一人前の商人を目指すパワフルお嬢様", 45, "ヒューマン", "松嵜麗", 103201, 3, "AB", 18, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "メルクリウス財団", "慈善事業", 12, 12, "アキノ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (142, "みんなを笑顔にするお笑い牧場主", 35, "ヒューマン", "新田恵海", 103301, 3, "B", 20, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "牧場（エリザベスパーク）", "漫才", 3, 11, "マヒル", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (164, "純情でほっとけない大人の女性", 55, "エルフ", "今井麻美", 103401, 3, "A", 22, "キミには情けないところばかり\n見られているけど、こんなところ、\nキミ以外には見せないんだからね？", "メルクリウス財団", "ウインドーショッピング", 16, 12, "ユカリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (118, "礼儀正しくしっかり者のちびっ子優等生", 21, "エルフ", "小倉唯", 103601, 2, "A", 8, "test", "リトルリリカル", "お勉強", 2, 5, "キョウカ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (149, "義理堅くてからかい好きな剣術少女", 43, "ヒューマン", "茅原実里", 103701, 8, "A", 13, "test", "王宮騎士団（NIGHTMARE）", "剣術、年長者をからかう", 11, 8, "トモ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (153, "読書が趣味の病弱少女", 40, "獣人族", "小清水亜美", 103801, 11, "A", 14, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "牧場（エリザベスパーク）", "読書、お散歩", 3, 11, "シオリ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "「友達」に憧れる、エルフの森の女の子", 44, "エルフ", "花澤香菜", 104001, 6, "AB", 13, "友達ができるその日まで…\nBB団で\nトレーニングですっ！", "フォレスティエ", "友達作りのイメトレ", 6, 6, "アオイ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "人々を守るために歌う、唱喚士の少女", 46, "ヒューマン", "福原綾香", 104201, 6, "O", 17, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", "各種楽器", 3, 4, "チカ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (168, "男勝りで情に厚いワイルド娘", 54, "獣人族", "小松未可子", 104301, 8, "O", 17, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "自警団（カォン）", "お菓子作り", 9, 10, "マコト", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (172, "かつては夜を支配した最強の吸血鬼", 50, "魔族", "丹下桜", 104401, 5, "A", "??", "test", "悪魔偽王国軍（ディアボロス）", "世界征服", 5, 7, "イリヤ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (157, "妄想大好き！　ほんとは照れ屋な女の子", 49, "ヒューマン", "長妻樹里", 104501, 11, "AB", 18, "あなたのことを考えていました\n…逆らえないクウカをああして、こうして\nぐふ、ぐふふふ…", "ヴァイスフリューゲル　ランドソル支部", "小説を読むこと", 19, 15, "クウカ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "弱きを助け強きをくじく猫娘", 48, "獣人族", "沼倉愛美", 104601, 3, "AB", 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "メルクリウス財団", "猫とたわむれること", 1, 12, "タマキ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (171, "素顔を見せない冷静沈着な女性騎士", 50, "ヒューマン", "川澄綾子", 104701, 10, "A", 25, "？？？", "王宮騎士団（NIGHTMARE）", "格闘技、湯浴み", 25, 8, "ジュン", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "仕事も私事も効率優先な傭兵少女", 49, "ヒューマン", "田所あずさ", 104801, 11, "O", 20, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "メルクリウス財団", "傭兵などのアルバイト", 11, 12, "ミフユ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (168, "お姉ちゃんがお世話してあげるからねっ！", 54, "ヒューマン", "生天目仁美", 104901, 10, "O", 18, "身の回りのお世話はお姉ちゃんがやってあげるね！\nお料理も、お洗濯も、お掃除も\nお風呂で背中も流してあげちゃうぞっ！", "ラビリンス", "家事全般", 24, 3, "シズル", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (120, "ちょっとおませな恋に恋する女の子", 22, "魔族", "久野美咲", 105001, 1, "A", 11, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 3, 14, "ミサキ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (166, "実験が趣味の危険な科学者", 53, "ヒューマン", "三石琴乃", 105101, 3, "A", 27, "私は科学者だけど、\n医者の真似事もしてるの\n病気になったら診てあげるわ", "トワイライトキャラバン", "研究、実験", 7, 13, "ミツキ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "乙女チックなもふもふアニマル", 100, "獣人族", "徳井青空", 105201, 3, "A", 18, "私、ごく普通の、どこにでもいる女の子よ！\nみ、見た目以外はね…", "牧場（エリザベスパーク）", "毛繕い、お喋り", 14, 11, "リマ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (140, "見た目も中身もお子ちゃまな異国の軍人", 33, "ヒューマン", "辻あゆみ", 105301, 7, "A", 18, "「白き翼」こと、ヴァイスフリューゲル…\nその名に恥じぬよう、天高く舞い、\n華麗に敵を倒してみせる！", "ヴァイスフリューゲル　ランドソル支部", "お菓子屋通い", 28, 15, "モニカ", 0);
