INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (156, "空への冒険を夢見る騎空士の少女", 45, "ヒューマン", "金元寿子", 105701, 3, "O", 17, "私ね、一人前の騎空士になりたいんだ\nいつか父さんみたいな騎空士になって、\n空の果てまで旅する。それが私の夢だよ！", "？？？", "冒険、おしゃべり", 10, "", "ジータ", 0);
