INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "弱きを助け強きをくじく猫娘", 48, "獣人族", "沼倉愛美", 107901, 3, "AB", 18, "お金もうけの話なら、ぜひともあたしに\n持ってくるにゃ！　稼げるなら１ルピだって\n見逃さないのが、あたしの信条にゃ～♪", "メルクリウス財団", "猫とたわむれること", 1, 12, "タマキ（サマー）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "仕事も私事も効率優先な傭兵少女", 49, "ヒューマン", "田所あずさ", 108001, 11, "O", 20, "私がキミの師匠になってあげる！\nもちろんタダとはいかないわ\n時給はしっかりもらうから", "メルクリウス財団", "傭兵などのアルバイト", 11, 12, "ミフユ（サマー）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (157, "占いが得意な霊能少女", 42, "魔族", "大坪由佳", 108101, 12, "AB", 18, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "悪魔偽王国軍（ディアボロス）", "占い", 22, 7, "シノブ（ハロウィン）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (130, "プリン大好きゴースト娘", 32, "魔族", "雨宮天", 108201, 1, "B", 14, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "悪魔偽王国軍（ディアボロス）", "プリンを食べること", 23, 7, "ミヤコ（ハロウィン）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (120, "ちょっとおませな恋に恋する女の子", 22, "魔族", "久野美咲", 108301, 1, "A", 11, "アタシのこと呼んだ？\nレディの魅力で夢中にさせてあげるわね！", "ルーセント学院", "ファッション誌鑑賞、コスメ集め", 3, 14, "ミサキ（ハロウィン）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "人々を守るために歌う、唱喚士の少女", 46, "ヒューマン", "福原綾香", 108401, 6, "O", 17, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", "各種楽器", 3, 4, "チカ（クリスマス）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (150, "泣き虫で臆病な守ってあげたい女の子", 40, "ヒューマン", "植田佳奈", 108501, 6, "B", 12, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", "観劇、おままごと", 9, 9, "クルミ（クリスマス）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (148, "ぷうきちといつも一緒！", 38, "ヒューマン", "芹澤優", 108601, 5, "B", 14, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "サレンディア救護院", "屋内でできる遊び", 10, 9, "アヤネ（クリスマス）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (155, "人助けが大好き！　前向き格闘娘", 44, "獣人族", "東山奈央", 108701, 8, "A", 16, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "トゥインクルウィッシュ", "人助け、応援", 27, 2, "ヒヨリ（ニューイヤー）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (158, "戦闘のサポートが得意な、心優しい少女", 47, "ヒューマン", "種田梨沙", 108801, 4, "O", 17, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "トゥインクルウィッシュ", "料理、人間観察", 5, 2, "ユイ（ニューイヤー）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "クールで何事にも真っ直ぐな剣士", 46, "魔族", "早見沙織", 108901, 1, "B", 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ", "読書、乗馬、お茶", 12, 2, "レイ（ニューイヤー）", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (154, "運命の相手に一途すぎる乙女", 43, "魔族", "橋本ちなみ", 109001, 7, "B", 16, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "トワイライトキャラバン", "実験、裁縫、料理", 30, 13, "エリコ（バレンタイン）", 0);
