INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (144, "マナリア魔法学院の新入生", 45, "ヒューマン", "こやまきみこ", 109301, 2, "O", 15, "ルゥはルゥですぅ！マナリア魔法学院に\n通ってるですぅ。あなたもルゥの\nお友だちになってくれるですか？", "？？？", "食べること、眠ること", 4, "", "ルゥ", 0);
INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (167, "人を超越した力を有す心優しい竜姫", 67, "半人半竜", "福原綾香", 109401, 11, "B", 17, "私はグレア。竜と人、両方の血を\n受け継いでいるの…\nえっと…よ、よろしくね", "？？？", "ピアノ", 3, "", "グレア", 0);
