INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (159, "前世を信じる中二病患者、「疾風の冥姫」", 45, "魔族", "髙野麻美", 121901, 7, "A", 17, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "トワイライトキャラバン", "小説執筆", 5, 13, "アンナ（パイレーツ）", 0);
