INSERT INTO `v1_14f75c3587ea32c8e5cc8a942d33b3dd81496ad5fb88ffd006b5661bb8741ab3` VALUES (163, "クールで何事にも真っ直ぐな剣士", 46, "魔族", "早見沙織", 122501, 1, "B", 18, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "トゥインクルウィッシュ", "読書、乗馬、お茶", 12, 2, "レイ（サマー）", 0);
